#------- Compilers ------------------------------------------------------------
default:
#                                      EDIT paths to LLVM and libraries:
    COMMON_FLAGS        = -target riscv64-unknown-linux-gnu -march=rv64gcv_zba_zbb_zbs_zcb \
                          -emit-llvm
    COMMON_LDFLAGS      = -v -target riscv64-unknown-linux-gnu \
                          -mabi=lp64d -march=rv64gcv_zba_zbb_zbs_zcb -fuse-ld=lld -flto \
                          -Wall \
                          -B/opt/riscv/gcc/lib/gcc/riscv64-unknown-linux-gnu/14.1.0/lib64/lp64d \
                          -B/opt/riscv/gcc/sysroot/usr/lib64/lp64d \
                          -L/opt/riscv/gcc/lib/gcc/riscv64-unknown-linux-gnu/14.1.0/lib64/lp64d
    CC                  = /usr/bin/clang-18 %{model} $(COMMON_FLAGS)
    CXX                 = /usr/bin/clang++-18 -std=c++03 %{model} $(COMMON_FLAGS) \
                          -I/opt/riscv/gcc/riscv64-unknown-linux-gnu/include/c++/14.1.0 \
                          -I/opt/riscv/gcc/riscv64-unknown-linux-gnu/include/c++/14.1.0/riscv64-unknown-linux-gnu/lib64/lp64d
    FORTRAN_COMP        = /usr/bin/flang-new-18 $(COMMON_FLAGS)
    FC                  = $(FORTRAN_COMP)
    CLD                 = /usr/bin/clang-18 $(COMMON_LDFLAGS) --sysroot /opt/riscv/gcc/sysroot
    CXXLD               = /usr/bin/clang++-18 $(COMMON_LDFLAGS) --sysroot /opt/riscv/gcc/sysroot
    FLD                 = /usr/bin/flang-new-18 \
                          -target riscv64-unknown-linux-gnu \
                          -march=rv64gcv_zba_zbb_zbs_zcb \
                          -fuse-ld=lld -flto \
                          -isysroot /opt/riscv/gcc/sysroot \
                          -L/opt/riscv/gcc/sysroot/lib64/lp64d \
                          -L/opt/riscv/gcc/lib/gcc/riscv64-unknown-linux-gnu/14.1.0/lib64/lp64d

    # How to say "Show me your version, please"
    CC_VERSION_OPTION   = -v
    CXX_VERSION_OPTION  = -v
    FC_VERSION_OPTION   = -v

default:
%if %{bits} == 64
   sw_base_ptrsize = 64-bit
   sw_peak_ptrsize = 64-bit
%else
   sw_base_ptrsize = 32-bit
   sw_peak_ptrsize = 32-bit
%endif

intrate,intspeed:                     # 502.gcc_r and 602.gcc_s may need the 
%if %{bits} == 32                     # flags from this section.  For 'base',
    EXTRA_COPTIMIZE = -fgnu89-inline  # all benchmarks must use the same 
%else                                 # options, so we add them to all of 
    LDCFLAGS        = -z muldefs      # integer rate and integer speed.  See:
%endif                                # www.spec.org/cpu2017/Docs/benchmarks/502.gcc_r.html

#--------- Portability --------------------------------------------------------
default:# data model applies to all benchmarks
%if %{bits} == 32
    # Strongly recommended because at run-time, operations using modern file 
    # systems may fail spectacularly and frequently (or, worse, quietly and 
    # randomly) if a program does not accommodate 64-bit metadata.
    EXTRA_PORTABILITY = -D_FILE_OFFSET_BITS=64
%else
    EXTRA_PORTABILITY = -DSPEC_LP64
%endif
    PORTABILITY = -march=rv64gcv_zba_zbb_zbs_zcb

# Benchmark-specific portability (ordered by last 2 digits of bmark number)

500.perlbench_r,600.perlbench_s:  #lang='C'
%if %{bits} == 32
%   define suffix IA32
%else
%   define suffix X64
%endif
   PORTABILITY    = -DSPEC_%{os}_%{suffix} 

521.wrf_r,621.wrf_s:  #lang='F,C'
   CPORTABILITY  = -DSPEC_CASE_FLAG 
   FPORTABILITY  = -fconvert=big-endian 

523.xalancbmk_r,623.xalancbmk_s:  #lang='CXX'
   PORTABILITY   = -DSPEC_%{os}

526.blender_r:  #lang='CXX,C'
    CPORTABILITY = -funsigned-char 
    CXXPORTABILITY = -D__BOOL_DEFINED 

527.cam4_r,627.cam4_s:  #lang='F,C'
   PORTABILITY   = -DSPEC_CASE_FLAG

628.pop2_s:  #lang='F,C'
    CPORTABILITY = -DSPEC_CASE_FLAG
    FPORTABILITY = -fconvert=big-endian 

#--------  Baseline Tuning Flags ----------------------------------------------
default=base:
    COPTIMIZE     = -O3
    CXXOPTIMIZE   = -O3
    FOPTIMIZE     = -O3 -Xclang -funroll-loops
    EXTRA_FFLAGS  = 
    EXTRA_FLIBS   = -lflang -lm
    LDOPTIMIZE    = -z muldefs
intrate,fprate:
    # preENV_LIBRARY_PATH     = $[LLVM_LIB_PATH]
    # preENV_LD_LIBRARY_PATH  = $[LLVM_LIB_PATH]
   #preENV_LIBRARY_PATH     = $[LLVM_LIB_PATH]:%{ENV_LIBRARY_PATH}
   #preENV_LD_LIBRARY_PATH  = $[LLVM_LIB_PATH]:%{ENV_LD_LIBRARY_PATH}

#
# Speed (OpenMP and Autopar allowed)
#
%if %{bits} == 32
   intspeed,fpspeed:
   #
   # Many of the speed benchmarks (6nn.benchmark_s) do not fit in 32 bits
   # If you wish to run SPECint2017_speed or SPECfp2017_speed, please use
   #
   #     runcpu --define bits=64
   #
   fail_build = 1
%else
   intspeed,fpspeed:
       OPENMP_LIB_PATH          = $[OPENMP_DIR]/lin_32e/lib
       EXTRA_OPTIMIZE           = -DSPEC_OPENMP -fopenmp -Wno-return-type -DUSE_OPENMP -I $(OPENMP_DIR)/common/include
       EXTRA_LIBS               = -fopenmp=libomp -L$(OPENMP_LIB_PATH) -lomp
       EXTRA_FLIBS              = -fopenmp=libomp -lgfortran -lm
      #  preENV_LIBRARY_PATH      = $[LLVM_LIB_PATH]:$[OPENMP_LIB_PATH]
      #  preENV_LD_LIBRARY_PATH   = $[LLVM_LIB_PATH]:$[OPENMP_LIB_PATH]
      #preENV_LIBRARY_PATH      = $[LLVM_LIB_PATH]:$[OPENMP_LIB_PATH]:%{ENV_LIBRARY_PATH}
      #preENV_LD_LIBRARY_PATH   = $[LLVM_LIB_PATH]:$[OPENMP_LIB_PATH]:%{ENV_LD_LIBRARY_PATH}
       preENV_OMP_THREAD_LIMIT  = %{cputhreads}
       preENV_OMP_STACKSIZE     = 128M
       preENV_GOMP_CPU_AFFINITY = 0-%{cputhreads}
%endif

#--------  Peak Tuning Flags ----------------------------------------------
default=peak:
    COPTIMIZE     = -Ofast
    CXXOPTIMIZE   = -O3 
    EXTRA_FLIBS   = -lgfortran -lm
    FOPTIMIZE     = -Ofast # -fno-stack-arrays
    EXTRA_FFLAGS  = # -fplugin=$(DRAGONEGG_PATH)/dragonegg.so

502.gcc_r,602.gcc_s=peak:  #lang='C'                        
    LDOPTIMIZE    = -z muldefs    

521.wrf_r,621.wrf_s=peak:  #lang='F,C'                      
    COPTIMIZE     = -O3 -freciprocal-math -ffp-contract=fast
    EXTRA_FLIBS   = -lgfortran -lm
    FOPTIMIZE     = -O3 -freciprocal-math -ffp-contract=fast
    EXTRA_FFLAGS  = # -fplugin=$(DRAGONEGG_PATH)/dragonegg.so

523.xalancbmk_r,623.xalancbmk_s=peak:  #lang='CXX           
    CXXOPTIMIZE   = -O3 

